import { useEffect } from 'react';
import './App.css';
import axios from 'axios';
import { useState } from 'react';

function App() {
  const [product, setProduct] = useState([]);
  useEffect(() => {
    axios.get("https://reqres.in/api/users?page=2").then((resp) =>{
      console.log("resp is ", resp.data.data);
      setProduct(resp.data.data);
    });
  }, []);
  return (
    <div className="App">
      Nikhitha
      <table border="1">
        <thead>
          <tr>
            <th>Id</th>
            <td>Name</td>
            <td>Avatar</td>
            <td>Email</td>
          </tr>
        </thead>
        <tbody>
        {product.map((item) =>(
          <tr key={item.id}>
            <td>{item.id}</td>
            <td>{item.first_name} {item.last_name}</td>
            <td><img src={item.avatar} width=""></img>  </td>
            <td>{item.email} </td>
          </tr>
        ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
